import React from 'react';
export const Navigation = (props) => {
  const handleClick = (evt) => {
    if(evt.target.getAttribute('id') === "#mission") {
      document.getElementById('root').classList.add('missionPage')
    } else {
      document.getElementById('root').classList.remove('missionPage')
    }

  }
  return (
    <nav id='menu' className='navbar navbar-default navbar-fixed-top'>
      <div className='container'>
        <div className='navbar-header'>
          <button
            type='button'
            className='navbar-toggle collapsed'
            data-toggle='collapse'
            data-target='#bs-example-navbar-collapse-1'
          >
            {' '}
            <span className='sr-only'>Toggle navigation</span>{' '}
            <span className='icon-bar'></span>{' '}
            <span className='icon-bar'></span>{' '}
            <span className='icon-bar'></span>{' '}
          </button>
          <a className='navbar-brand page-scroll' href='#page-top' onClick={handleClick}>
             <img src='img/logo_top.png' alt='' />{' '}
          </a>{' '}
        </div>

        <div
          className='collapse navbar-collapse'
          id='bs-example-navbar-collapse-1'
        >
          <ul className='nav navbar-nav navbar-right'>
            <li>
              <a href='#page-top' id="mission" className='page-scroll' onClick={handleClick}>
                Mission
              </a>
            </li>
            <li>
              <a href='#career' className='page-scroll'>
                Careers
              </a>
            </li>
            <li>
              <a href='#contact' className='page-scroll'>
                Contact us
              </a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  )
}
